// src/App.js
import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [activeTab, setActiveTab] = useState("Home");

  const renderContent = () => {
    switch (activeTab) {
      case "Home":
        return <UpcomingInterviews />;
      case "Interviewers":
        return <InterviewersTable />;
      case "Candidates":
        return <CandidatesTable />;
      case "Reports":
        return <Reports />;
      case "Settings":
        return <Settings />;
      default:
        return <UpcomingInterviews />;
    }
  };

  return (
    <div className="app-container">
      <h1 className="dashboard-title">Interview Management Dashboard</h1>
      <nav className="navbar">
        {["Home", "Interviewers", "Candidates", "Reports", "Settings"].map((tab) => (
          <div
            key={tab}
            className={`nav-item ${activeTab === tab ? "active" : ""}`}
            onClick={() => setActiveTab(tab)}
          >
            {tab}
          </div>
        ))}
      </nav>
      <div className="content">{renderContent()}</div>
    </div>
  );
};

const UpcomingInterviews = () => (
  <div className="upcoming-interviews">
    <h2>Upcoming Interviews</h2>
    <ul>
      <li>Interview with John Doe - 2024-10-10</li>
      <li>Interview with Jane Smith - 2024-10-12</li>
    </ul>
  </div>
);

const InterviewersTable = () => (
  <div className="table-container">
    <h2>Interviewers</h2>
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email ID</th>
          <th>More Details</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>Dr. Alice Johnson</td>
          <td>alice@example.com</td>
          <td><button>Details</button></td>
        </tr>
        <tr>
          <td>Mr. Bob Lee</td>
          <td>bob@example.com</td>
          <td><button>Details</button></td>
        </tr>
      </tbody>
    </table>
  </div>
);

const CandidatesTable = () => (
  <div className="table-container">
    <h2>Candidates</h2>
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email ID</th>
          <th>More Details</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>Emily Davis</td>
          <td>emily@example.com</td>
          <td><button>Details</button></td>
        </tr>
        <tr>
          <td>Mark Brown</td>
          <td>mark@example.com</td>
          <td><button>Details</button></td>
        </tr>
      </tbody>
    </table>
  </div>
);

const Reports = () => (
  <div className="reports">
    <h2>Reports</h2>
    <ul>
      <li>Total Interviews: 10</li>
      <li>Upcoming Interviews: 2</li>
      <li>Completed Interviews: 8</li>
    </ul>
  </div>
);

const Settings = () => (
  <div className="settings">
    <h2>Settings</h2>
    <p>Change Theme: Light / Dark</p>
    {/* Include toggle for theme */}
  </div>
);

export default App;
